import React from "react";
import { observer } from "mobx-react-lite";

function MainPage() {
  return (
    <div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <h1>Полина Мальцева</h1>
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <h3>Ведущий эксперт в теме школьного образования</h3>
      </div>
      <div
        // style={{
        //   display: "flex",
        //   justifyContent: "center",
        // }}
      >
        <p>
          Помогаю родителям и школам выстраивать траекторию обучения и развития
          детей
            — Руководила проектом создания школы «Летово» — Возглавляю
          социальную инфраструктуру г. Доброград, в котором в 2021 была открыта
          школа «Мир» —Работала в Департаменте образования г. Сан-Франциско —
          Имею 4 высших образования, в том числе Harvard Business School (MBA)
        </p>
      </div>
    </div>
  );
}

export default observer(MainPage);
